$(document).ready(function() {

    const urlPDF = '../sopirobo-main/cv_portfolio_2024.pdf';
    var encodage = "data:image/pdf;base64,"

    $('#BtnImpression').off('click').on('click', function (event) {
        download(encodage, "CV_Adrien_Niceto.pdf")
    });

    $('#BtnOuvrir').off('click').on('click', function () {
        window.open(urlPDF, '_blank');
    });

    function download(encodage, filename) {
        fetch(encodage)
          .then(response => response.blob())
          .then(blob => {
            const link = document.createElement("a");
            link.href = URL.createObjectURL(blob);
            link.download = filename;
            document.body.appendChild(link);
            link.click();
            })
        .catch(console.error);
      }
});